import React from 'react';
import '../App.css';
import WorkProcessCard from './WorkProcessCard';
import './WorkProcess.css';
import { Grid, makeStyles, Typography } from '@material-ui/core';


const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
      backgroundColor:'red',
      margin:'1px'
    },
  }));

function WorkProcess(){
    const classes = useStyles();
    return (
        <div className="works_cards">
            <h1>Work Process</h1>
            <p className="work_title">To make life of our clients easier, we have developed a comprehensive workflow.</p>
            {/* <Grid className="cards__container">
                <div className="cards__wrapper"> */}
                    <Grid container spacing={2} >
                    <Grid item sm={12} md={2} className={classes.paper}>
                        <Typography>Get Ideas</Typography>
                        <Typography>Every Project start with great idea and good motivation</Typography>

                    </Grid>
                    <Grid item sm={12} md={2} className={classes.paper}>
                    <Typography>Discuss</Typography>
                        <Typography>Your inputs are most valuable asset for success.</Typography>

                    </Grid>
                    <Grid item sm={12} md={2} className={classes.paper}>
                    <Typography>Make Plan</Typography>
                        <Typography>An thoughtful execution plan ensures timely delivery.</Typography>

                    </Grid>
                    <Grid item sm={12} md={2} className={classes.paper}>
                    <Typography>Production</Typography>
                        <Typography>Lights Camera Action! All the magic happens here.</Typography>

                    </Grid>
                    <Grid item sm={12} md={2} className={classes.paper}>
                    <Typography>Post Production</Typography>
                        <Typography>Where everything is creatively stitched together.</Typography>

                    </Grid>
                    <Grid item sm={12} md={2} className={classes.paper}>
                    <Typography>Approval</Typography>
                        <Typography>Your approval really means a lot for our entire team.</Typography>

                    </Grid>

                    {/* </Grid>
                </div> */}
            </Grid>
        </div>
    )
}

export default WorkProcess
